function changeTheme(b,a){let link="styles/themes/"+b+"/"+a+".min.css";$("#theme").attr("href",link)}function initTheme(a){let date=new Date();let theme="light";if((date.getHours()>=18)||(date.getHours()<8)){theme="dark"}if(localStorage.getItem("theme_"+a)){theme=localStorage.getItem("theme_"+a)}changeTheme(theme,a)};